import{_ as A,o as E,c as B,a as Q}from"./app.0f047030.js";const g={},M=Q('<img src="https://count-viewer.vercel.app//api/blog/view?url=https://creatipath.github.io/after-effects/section2.html" alt="Image 1" style="float:left;"><h1 id="_2-\u0111ac-trung-noi-bat-cua-adobe-after-effects" tabindex="-1"><a class="header-anchor" href="#_2-\u0111ac-trung-noi-bat-cua-adobe-after-effects" aria-hidden="true">#</a> 2. \u0110\u1EB7c tr\u01B0ng n\u1ED5i b\u1EADt c\u1EE7a Adobe After Effects</h1><p>V\u1EDBi kh\u1EA3 n\u0103ng t\u1EA1o ra nh\u1EEFng hi\u1EC7u \u1EE9ng \u0111\u1EB7c bi\u1EC7t v\xE0 l\xE0m \u0111\u1ED9ng h\xECnh v\u1EDBi \u0111\u1ED9 ch\xEDnh x\xE1c tuy\u1EC7t v\u1EDDi, After Effects \u0111\xE3 tr\u1EDF th\xE0nh m\u1ED9t ph\u1EA7n kh\xF4ng th\u1EC3 thi\u1EBFu c\u1EE7a ng\xE0nh c\xF4ng nghi\u1EC7p s\xE1ng t\u1EA1o hi\u1EC7n \u0111\u1EA1i. V\u1EADy, \u0111i\u1EC1u g\xEC l\xE0m n\xEAn s\u1EE9c h\xFAt \u0111\u1EB7c bi\u1EC7t c\u1EE7a c\xF4ng c\u1EE5 n\xE0y? \u0110i\u1EC3m \u0111\u1EB7c tr\u01B0ng n\u1ED5i b\u1EADt c\u1EE7a Adobe After Effects l\xE0 g\xEC?</p><h2 id="_2-1-tao-hieu-ung-hinh-anh-song-\u0111ong" tabindex="-1"><a class="header-anchor" href="#_2-1-tao-hieu-ung-hinh-anh-song-\u0111ong" aria-hidden="true">#</a> 2.1. T\u1EA1o hi\u1EC7u \u1EE9ng, h\xECnh \u1EA3nh s\u1ED1ng \u0111\u1ED9ng</h2><p>Adobe c\xF3 m\u1ED9t s\u1ED1 \u0111\u1EB7c tr\u01B0ng \u0111\xE1ng ch\xFA \xFD, v\xE0 m\u1ED9t trong nh\u1EEFng \u0111i\u1EC3m n\u1ED5i b\u1EADt \u0111\u1EA7u ti\xEAn l\xE0 kh\u1EA3 n\u0103ng t\u1EA1o ra nh\u1EEFng hi\u1EC7u \u1EE9ng mang t\xEDnh s\u1ED1ng \u0111\u1ED9ng cho h\xECnh \u1EA3nh. \u0110i\u1EC1u n\xE0y \u0111\u01B0\u1EE3c th\u1EC3 hi\u1EC7n th\xF4ng qua c\xF4ng c\u1EE5 Global Performance Cache, m\u1ED9t c\xF4ng c\u1EE5 \u0111\u01B0\u1EE3c thi\u1EBFt k\u1EBF \u0111\u1EB7c bi\u1EC7t \u0111\u1EC3 x\u1EED l\xFD hi\u1EC7u \u1EE9ng trong video. V\u1EDBi c\xF4ng c\u1EE5 n\xE0y, ng\u01B0\u1EDDi d\xF9ng c\xF3 kh\u1EA3 n\u0103ng nhanh ch\xF3ng ch\xE8n \u1EA3nh v\xE0 t\u1EA1o ra c\xE1c hi\u1EC7u \u1EE9ng t\u1EEB nh\u1EEFng \u0111i\u1EC1u \u0111\u01A1n gi\u1EA3n \u0111\u1EBFn nh\u1EEFng hi\u1EC7u \u1EE9ng ph\u1EE9c t\u1EA1p.</p><p><img src="data:image/jpeg;base64," alt="Adobe After Effects l\xE0 g\xEC?- h\xECnh 3"></p><p>Ngo\xE0i ra, c\xF4ng c\u1EE5 Motion Blur c\u0169ng l\xE0 m\u1ED9t ph\u1EA7n kh\xF4ng th\u1EC3 thi\u1EBFu, h\u1ED7 tr\u1EE3 vi\u1EC7c t\u1EA1o s\u1EF1 m\u01B0\u1EE3t m\xE0 cho c\xE1c ph\xE2n c\u1EA3nh chuy\u1EC3n \u0111\u1ED9ng nhanh trong video. \u0110i\u1EC1u n\xE0y \u0111\xF3ng vai tr\xF2 quan tr\u1ECDng trong vi\u1EC7c n\xE2ng cao ch\u1EA5t l\u01B0\u1EE3ng s\u1EA3n ph\u1EA9m cu\u1ED1i c\xF9ng c\u1EE7a ng\u01B0\u1EDDi d\xF9ng, gi\xFAp video tr\u1EDF n\xEAn chuy\u1EC3n \u0111\u1ED9ng m\u01B0\u1EE3t m\xE0 v\xE0 h\u1EA5p d\u1EABn h\u01A1n.</p><h2 id="_2-2-theo-doi-nhung-thanh-phan-3d-kiem-soat-chieu-sau-bong-phan-xa" tabindex="-1"><a class="header-anchor" href="#_2-2-theo-doi-nhung-thanh-phan-3d-kiem-soat-chieu-sau-bong-phan-xa" aria-hidden="true">#</a> 2.2. Theo d\xF5i nh\u1EEFng th\xE0nh ph\u1EA7n 3D, ki\u1EC3m so\xE1t chi\u1EC1u s\xE2u, b\xF3ng, ph\u1EA3n x\u1EA1</h2><p>Trong qu\xE1 tr\xECnh ch\u1EC9nh s\u1EEDa v\xE0 thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa, vi\u1EC7c theo d\xF5i c\xE1c th\xE0nh ph\u1EA7n 3D, ki\u1EC3m so\xE1t chi\u1EC1u s\xE2u, b\xF3ng, v\xE0 ph\u1EA3n x\u1EA1 l\xE0 r\u1EA5t quan tr\u1ECDng \u0111\u1EC3 t\u1EA1o ra h\xECnh \u1EA3nh \u0111\u1EA7y \u1EA5n t\u01B0\u1EE3ng v\xE0 chuy\xEAn nghi\u1EC7p.</p><ul><li><strong>Theo d\xF5i c\xE1c th\xE0nh ph\u1EA7n 3D</strong>: C\xE1c c\xF4ng c\u1EE5 hi\u1EC7n \u0111\u1EA1i trong ph\u1EA7n m\u1EC1m nh\u01B0 Adobe gi\xFAp theo d\xF5i c\xE1c th\xE0nh ph\u1EA7n 3D, cho ph\xE9p b\u1EA1n xem v\xE0 ch\u1EC9nh s\u1EEDa c\xE1c y\u1EBFu t\u1ED1 trong kh\xF4ng gian ba chi\u1EC1u. \u0110i\u1EC1u n\xE0y bao g\u1ED3m vi\u1EC7c xem c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng t\u1EEB nhi\u1EC1u g\xF3c \u0111\u1ED9 kh\xE1c nhau v\xE0 thay \u0111\u1ED5i v\u1ECB tr\xED c\u1EE7a ch\xFAng \u0111\u1EC3 t\u1EA1o ra hi\u1EC7u \u1EE9ng 3D t\u1ED1t nh\u1EA5t.</li><li><strong>Ki\u1EC3m so\xE1t chi\u1EC1u s\xE2u</strong>: C\xF4ng c\u1EE5 n\xE0y cho ph\xE9p b\u1EA1n \u0111i\u1EC1u ch\u1EC9nh v\xE0 qu\u1EA3n l\xFD chi\u1EC1u s\xE2u c\u1EE7a c\xE1c y\u1EBFu t\u1ED1 trong h\xECnh \u1EA3nh. B\u1EB1ng c\xE1ch \u0111i\u1EC1u ch\u1EC9nh chi\u1EC1u s\xE2u, b\u1EA1n c\xF3 th\u1EC3 t\u1EA1o ra hi\u1EC7u \u1EE9ng 3D s\xE2u r\xF5 r\xE0ng, t\u0103ng c\u01B0\u1EDDng s\u1EF1 th\u1ECB gi\xE1c v\xE0 t\u1EA1o c\u1EA3m gi\xE1c chi\u1EC1u s\xE2u cho h\xECnh \u1EA3nh.</li><li><strong>B\xF3ng v\xE0 ph\u1EA3n x\u1EA1</strong>: Vi\u1EC7c \u0111i\u1EC1u ch\u1EC9nh b\xF3ng v\xE0 ph\u1EA3n x\u1EA1 l\xE0m t\u0103ng t\xEDnh th\u1EF1c t\u1EBF v\xE0 s\u1EF1 hi\u1EC7n di\u1EC7n c\u1EE7a c\xE1c y\u1EBFu t\u1ED1 3D trong m\xF4i tr\u01B0\u1EDDng \u1EA3o. B\xF3ng v\xE0 ph\u1EA3n x\u1EA1 c\xF3 th\u1EC3 \u0111\u01B0\u1EE3c \u0111i\u1EC1u ch\u1EC9nh \u0111\u1EC3 ph\u1EA3n \xE1nh \xE1nh s\xE1ng t\u1EEB c\xE1c ngu\u1ED3n kh\xE1c nhau v\xE0 t\u1EA1o ra c\u1EA3m gi\xE1c t\u1EF1 nhi\xEAn h\u01A1n cho h\xECnh \u1EA3nh.</li></ul><p><img src="data:image/jpeg;base64," alt="Adobe After Effects l\xE0 g\xEC?- h\xECnh 4"></p><p>Nh\u1EEFng c\xF4ng c\u1EE5 n\xE0y kh\xF4ng ch\u1EC9 gi\xFAp b\u1EA1n t\u1EA1o ra c\xE1c h\xECnh \u1EA3nh 3D s\u1ED1ng \u0111\u1ED9ng m\xE0 c\xF2n cho ph\xE9p b\u1EA1n ki\u1EC3m so\xE1t m\u1ECDi kh\xEDa c\u1EA1nh c\u1EE7a kh\xF4ng gian 3D, t\u1EEB chi\u1EC1u s\xE2u \u0111\u1EBFn c\xE1ch \xE1nh s\xE1ng t\u01B0\u01A1ng t\xE1c v\u1EDBi c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng, t\u1EA1o ra m\u1ED9t h\xECnh \u1EA3nh \u1EA5n t\u01B0\u1EE3ng v\xE0 ch\xE2n th\u1EF1c.</p><h2 id="_2-3-tich-hop-voi-phan-mem-adobe-illustrator" tabindex="-1"><a class="header-anchor" href="#_2-3-tich-hop-voi-phan-mem-adobe-illustrator" aria-hidden="true">#</a> 2.3. T\xEDch h\u1EE3p v\u1EDBi ph\u1EA7n m\u1EC1m Adobe Illustrator</h2><p>Adobe Illustrator l\xE0 m\u1ED9t trong nh\u1EEFng ph\u1EA7n m\u1EC1m thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa vector h\xE0ng \u0111\u1EA7u v\xE0 th\u01B0\u1EDDng \u0111\u01B0\u1EE3c s\u1EED d\u1EE5ng \u0111\u1EC3 t\u1EA1o c\xE1c h\xECnh \u1EA3nh vector v\xE0 bi\u1EC3u \u0111\u1ED3 ch\u1EA5t l\u01B0\u1EE3ng cao. C\xE1c s\u1EA3n ph\u1EA9m c\u1EE7a Adobe, nh\u01B0 Adobe After Effects ho\u1EB7c Adobe Premiere Pro, th\u01B0\u1EDDng c\xF3 kh\u1EA3 n\u0103ng t\u01B0\u01A1ng t\xE1c t\u1ED1t v\u1EDBi Illustrator th\xF4ng qua t\xEDnh n\u0103ng t\xEDch h\u1EE3p. \u0110i\u1EC1u n\xE0y mang l\u1EA1i nhi\u1EC1u l\u1EE3i \xEDch cho ng\u01B0\u1EDDi d\xF9ng:</p><ul><li><strong>T\xEDch h\u1EE3p \u0111\u1ED3 h\u1ECDa t\u1EEB Illustrator v\xE0o video ho\u1EB7c hi\u1EC7u \u1EE9ng chuy\u1EC3n \u0111\u1ED9ng</strong>: B\u1EA1n c\xF3 th\u1EC3 t\u1EA1o ho\u1EB7c ch\u1EC9nh s\u1EEDa c\xE1c h\xECnh \u1EA3nh vector trong Illustrator v\xE0 sau \u0111\xF3 t\xEDch h\u1EE3p ch\xFAng tr\u1EF1c ti\u1EBFp v\xE0o d\u1EF1 \xE1n video trong c\xE1c ph\u1EA7n m\u1EC1m nh\u01B0 After Effects ho\u1EB7c Premiere Pro. \u0110i\u1EC1u n\xE0y mang l\u1EA1i t\xEDnh linh ho\u1EA1t cao v\xE0 cho ph\xE9p b\u1EA1n th\xEAm \u0111\u1ED3 h\u1ECDa vector ch\u1EA5t l\u01B0\u1EE3ng cao v\xE0o s\u1EA3n ph\u1EA9m video c\u1EE7a m\xECnh.</li><li><strong>S\u1EED d\u1EE5ng t\u1EC7p Illustrator trong c\xE1c d\u1EF1 \xE1n After Effects</strong>: T\xEDnh n\u0103ng t\xEDch h\u1EE3p gi\xFAp b\u1EA1n m\u1EDF t\u1EC7p t\u1EEB Illustrator tr\u1EF1c ti\u1EBFp trong After Effects m\xE0 kh\xF4ng c\u1EA7n chuy\u1EC3n \u0111\u1ED5i ho\u1EB7c m\u1EA5t th\xF4ng tin \u0111\u1ECBnh d\u1EA1ng. \u0110i\u1EC1u n\xE0y ti\u1EBFt ki\u1EC7m th\u1EDDi gian v\xE0 gi\u1EEF nguy\xEAn t\xEDnh ch\u1EA5t c\u1EE7a c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng vector.</li><li><strong>Ch\u1EC9nh s\u1EEDa linh ho\u1EA1t</strong>: Vi\u1EC7c c\xF3 kh\u1EA3 n\u0103ng l\xE0m vi\u1EC7c linh ho\u1EA1t gi\u1EEFa Illustrator v\xE0 c\xE1c ph\u1EA7n m\u1EC1m kh\xE1c trong b\u1ED9 Adobe gi\xFAp b\u1EA1n ch\u1EC9nh s\u1EEDa v\xE0 \u0111i\u1EC1u ch\u1EC9nh c\xE1c y\u1EBFu t\u1ED1 vector m\u1ED9t c\xE1ch d\u1EC5 d\xE0ng m\xE0 kh\xF4ng c\u1EA7n ph\u1EA3i m\u1EA5t th\u1EDDi gian chuy\u1EC3n \u0111\u1ED5i ho\u1EB7c \u0111i\u1EC1u ch\u1EC9nh l\u1EA1i t\u1EEB \u0111\u1EA7u.</li></ul><p><img src="data:image/jpeg;base64," alt="Adobe After Effects l\xE0 g\xEC?- h\xECnh 5"></p><p>T\xEDch h\u1EE3p gi\u1EEFa c\xE1c ph\u1EA7n m\u1EC1m trong b\u1ED9 c\xF4ng c\u1EE5 Adobe gi\xFAp t\u1ED1i \u01B0u h\xF3a qu\xE1 tr\xECnh l\xE0m vi\u1EC7c, \u0111\u1EB7c bi\u1EC7t l\xE0 khi b\u1EA1n l\xE0m vi\u1EC7c v\u1EDBi c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng vector t\u1EEB Illustrator trong c\xE1c d\u1EF1 \xE1n video v\xE0 hi\u1EC7u \u1EE9ng chuy\u1EC3n \u0111\u1ED9ng.</p><h2 id="_2-4-tuong-thich-tot-voi-nhieu-phan-mem" tabindex="-1"><a class="header-anchor" href="#_2-4-tuong-thich-tot-voi-nhieu-phan-mem" aria-hidden="true">#</a> 2.4. T\u01B0\u01A1ng th\xEDch t\u1ED1t v\u1EDBi nhi\u1EC1u ph\u1EA7n m\u1EC1m</h2><p>Ph\u1EA7n m\u1EC1m Adobe, nh\u01B0 Adobe After Effects, <a href="https://fptshop.com.vn/tin-tuc/danh-gia/adobe-premiere-la-gi-nhung-diem-uu-noi-troi-cua-ung-dung-adobe-premiere-156089" target="_blank" rel="noopener noreferrer">Premiere Pro</a>, <a href="https://fptshop.com.vn/tin-tuc/thu-thuat/cach-su-dung-photoshop-160235" target="_blank" rel="noopener noreferrer">Photoshop</a> v\xE0 Illustrator, th\u01B0\u1EDDng c\xF3 kh\u1EA3 n\u0103ng t\u01B0\u01A1ng th\xEDch cao v\u1EDBi nhau. \u0110i\u1EC1u n\xE0y gi\xFAp ng\u01B0\u1EDDi d\xF9ng d\u1EC5 d\xE0ng t\xEDch h\u1EE3p v\xE0 l\xE0m vi\u1EC7c linh ho\u1EA1t gi\u1EEFa c\xE1c \u1EE9ng d\u1EE5ng kh\xE1c nhau trong b\u1ED9 c\xF4ng c\u1EE5 Adobe, t\u1EEB ch\u1EC9nh s\u1EEDa video \u0111\u1EBFn x\u1EED l\xFD \u0111\u1ED3 h\u1ECDa vector v\xE0 h\xECnh \u1EA3nh. Ngo\xE0i ra, ch\xFAng c\u0169ng c\xF3 th\u1EC3 t\u01B0\u01A1ng th\xEDch v\u1EDBi m\u1ED9t s\u1ED1 plug-in v\xE0 \u1EE9ng d\u1EE5ng t\u1EEB b\xEAn ngo\xE0i, m\u1EDF r\u1ED9ng kh\u1EA3 n\u0103ng s\xE1ng t\u1EA1o v\xE0 t\u1ED1i \u01B0u h\xF3a quy tr\xECnh l\xE0m vi\u1EC7c.</p><p><img src="data:image/jpeg;base64," alt="Adobe After Effects l\xE0 g\xEC?- h\xECnh 6"></p>',20),U=[M];function i(R,D){return E(),B("div",null,U)}var S=A(g,[["render",i],["__file","section2.html.vue"]]);export{S as default};
